import React from 'react';
import "./intro.scss";
import {init} from 'ityped';
import { useEffect, useRef } from "react";

export default function Intro() {
   
  const textRef = useRef();

  useEffect(() => {
    init(textRef.current, {
      showCursor: true,
      backDelay: 1500,
      backSpeed:60,
      strings: ["BALUSTRADE", "SCARI", "GRILAJE"],
    });
  }, []);


  return (
    <div className="intro" id="intro">
      <div className="left">
           <div className="itemContainer">
           <iframe src="https://giphy.com/embed/MyAkvpzL0tcgikS807" width="480" height="270" frameBorder="0" class="giphy-embed" allowFullScreen title="sudare"/>
           </div>
      </div>

      <div className="right">
        <div className="wrapper">
          <h2>GARDURI METALICE</h2>
          <h1>BALUSTRADE</h1>
          <h3>SCARI METALICE <span ref={textRef}></span></h3>
        </div>

        <a href="#portofolio" >
          <img src="assets/down.png" alt=""/>
        </a>
      </div>
    </div>
  )
}
